  /* This is used for authors and editors */
  function personRenderer($$, entityId, entityDb, options = {}) {
    let { prefix, suffix, givenNames, surname } = entityDb.get(entityId);
    if (options.short) {
      givenNames = _getInitials(givenNames);
    }
    let result = [];
    if (prefix) {
      result.push(prefix, ' ');
    }
    result.push(
      givenNames,
      ' ',
      surname
    );
    if (suffix) {
      result.push(' (', suffix, ')');
    }
    return result
  }


  /* This is used within references */
  function refPersonRenderer($$, entry, options = {}) {
    let { prefix, suffix, givenNames, surname } = entry;
    if (options.short) {
      givenNames = _getInitials(givenNames);
    }
    let result = [];
    if (prefix) {
      result.push(prefix, ' ');
    }
    result.push(
      surname,
      ' ',
      givenNames
    );
    if (suffix) {
      result.push(' (', suffix, ')');
    }
    return result
  }

  function organisationRenderer($$, entityId, entityDb, options = {}) {
    let { name, country } = entityDb.get(entityId);
    let result = [ name ];
    if (!options.short) {
      if (country) {
        result.push(', ', country);
      }
    }
    return result
  }

